import React, {Component} from 'react';
import './Projects.css';

class Projects extends Component{
    render() {
        return(
            <div className="container">
                <div className="row">
                    <div className="projects col-lg-2 col-md-12 col-sm-12 col-xs-12">
                        <h1>Projetos</h1>
                    </div>
                    <div  align="center">
                        <button></button>
                    </div>
                </div>
            </div>
        )
    }
    }

export default Projects;
